import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'pureExpontial',
  pure: true
})
export class PureExpontialPipe implements PipeTransform {

  transform(value: any , exponent=5): any {
    return Math.pow(value, exponent);
  }

}
